import React, { Component } from 'react';
import { Container, Row, Col } from 'react-bootstrap';

export default class GameInfoPage extends Component {
  render() {
    return (
      <Container>
        <Row>
          <Col lg={2}>
            About Game
          </Col>
          <Col lg={10}>
            Game Info Box
          </Col>
        </Row>
      </Container>
    )
  }
}
